import React from 'react'
import { BrowserRouter, Route, Switch ,Redirect,useRouteMatch} from 'react-router-dom';
import Notes from './public/notes';

import Reminders from './public/reminders';
import Labels from './public/labels';
import ModifyLabels from './public/modify-labels';
import Archive from './public/archive';
import Delete from './public/Delet';

 const RightLayout = ({match, isAdmin}) => {
   const { url } = match;
   console.log('url',url);
   // let { path, url } = useRouteMatch();
   console.log('url', url);
   // console.log('path', path);
    return (

       <BrowserRouter>




       <Route exact path={`${url}/notes`} component={Notes}/>

       <Route exact path={`${url}/reminders`} component={Reminders}/>
       <Route exact path={`${url}/labels`} component={Labels}/>
       <Route exact path={`${url}/archive`} component={Archive}/>
       <Route exact path={`${url}/modifyLabels`} component={ModifyLabels}/>
       <Route exact path={`${url}/delete`} component={Delete}/>


       </BrowserRouter>
    )
}

RightLayout.propTypes = {
   match: PropTypes.shape({
       url: PropTypes.string.isRequired
   }).isRequired,
   isAdmin: PropTypes.bool
};
export default RightLayout;
